import React from "react";

const Nav = () => {
  return (
    <nav className="#4db6ac teal lighten-2">
      <ul class="row">
        <link to="/all">
          <li class="col s12 m4 l4 center">All</li>
        </link>
        <li class="col s12 m4 l4 center">Process</li>
        <li class="col s12 m4 l4 center">Done</li>
      </ul>
    </nav>
  );
};

export default Nav;
